class Solution:
    def maxOperations(self, s: str) -> int:
        result = 0
        cur = 0
        end = True
        for c in list(s):
            if c == '1':
                if not end:
                    result += cur
                cur += 1
                end = True
            else:
                end = False
        if s[-1] != '1':
            result += cur
        return result
